pub enum ConnectAddrsIter<'a> {
    None,
    One(SocketAddr),
    Multi(vec_deque::Iter),
    MultiOwned(vec_deque::IntoIter<SocketAddr>),
}

pub enum TcpConnectorResponse<T> {
    Response {
        req: Option<T>,
        port: u16,
        local_addr: Option<IpAddr>,
        addrs: Option<VecDeque<SocketAddr>>,
        stream: ReusableBoxFuture<Result<TcpStream, io::Error>>,
    },
    Error(Option<ConnectError>),
}

pub enum ConnectError {

    /// Failed to resolve the hostname
    #[display(fmt = "Failed resolving hostname: {}", _0)]
    Resolver(Box<std::error::Error>),

    /// No dns records
    #[display(fmt = "No dns records found for the input")]
    NoRecords,

    /// Invalid input
    InvalidInput,

    /// Unresolved host name
    #[display(fmt =
              "Connector received `Connect` method with unresolved host")]
    Unresolved,

    /// Connection IO error
    #[display(fmt = "{}", _0)]
    Io(io::Error),
}

pub enum ResolverFuture<T: Address> {
    Connected(Option<Connect<T>>),
    LookUp(JoinHandle<io::Result<IntoIter<SocketAddr>>>, Option<Connect<T>>),
    LookupCustom(LocalBoxFuture),
}
